script: |
  super -f text -I q9680.spq | sort > q9680.out

inputs:
  - name: q9680.spq
    data: |
      SELECT ALL - ( - col1 ) + col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( + col2 = + col0 / col0 );
  - name: tab0

outputs:
  - name: q9680.out
    data: |
      100
      128
      31
